  <Auth0Provider
    domain='dev-vsd6x42q.us.auth0.com'
    clientId='44GEDq7m6Gt3yKnUvd5d7AxYPnvNnR3f'
    redirectUri={window.location.origin}>
    <App />
  </Auth0Provider>,
  document.getElementById("root")
);
